export default class Car{
  constructor(brand=null, motor=null,color=null){
    this._brand = brand;
    this._motor = motor;
    this._color = color;
  }

  cloneCar() {
    const clone = new this.constructor();
    const symbols = Object.getOwnPropertySymbols(this);
    symbols.map(symbol => clone[symbol] = this[symbol]);
    return clone;
  }
}
